- proto: Paper
  entities:
  - uid: 784
    components:
    - type: Transform
      pos: 1.4973564,-28.549911
      parent: 1
    - type: Paper
      stampState: paper_stamp-syndicate
      stampedBy:
      - reapply: False
        stampType: RubberStamp
        stampedColor: '#850000FF'
        stampedName: stamp-component-stamped-name-syndicate
      content: >-
        Ох уж этот LaserBeam... А стоп... Её ещё и переименовать успели!?


        Ладно пропустим... Как вы видите, наши инженеры опять выпустили её новую версию. Торпеды, как вы видите, они зажали, моль говорят ДОРОГО и затратно в обслуживаний. Хорошо что они ещё эту бандуру по центру не забрали.
         Что же они предложили вместо торпед?
        пусковые установки GPOB-L и 150mm орудия. Ну хоть что-то...


        GPOB-L, ракеты:


        ASM(LF)5 "Zenith" - Ракеты со средней скоростью, имеющие самонаводку и неплохой пробивную мощность.


        AD-901 "QUASAR" - Неуправляемая ракета, но имеющий скорость равный скорости снаряда рельсотрона. Имеет крайне высокое но узкое пробитие, по сути железная болванка.


        GPO-L 50kg Unguided Bomb - Охохо, да... Нет... Не используйте её прошу вас... Одумайтесь. Медленная, неуправляемая, но очень мощная бомба, единственное применение ей вы найдёте в ближнем бою.


        Консоль управления:


        Кнопка 1 -> Северный гермозатвор.

        Кнопка 2 -> Южный гермозатвор.

        Кнопка 3 -> Открывает и удерживает двери, для удобства заряжающего.


        Про удобства заряжающего, теперь гермозатворы не уходят в рассинхронизацию вместе с шлюзом. Но шлюз надо теперь закрывать вручную... Или вовсе не закрывать, если вы так сильно любите космический ветер.
    - type: UserInterface
      actors:
        enum.PaperUiKey.Key:
        - invalid
    - type: ActiveUserInterface
